def decode_mammoth_genome(n, s):
    if n % 4 == 0:
        return '==='
    t = n // 4
    count = [0] * 5
    for char in s:
        if char == '?':
            count[0] += 1
        elif char == 'A':
            count[1] += 1
        elif char == 'C':
            count[2] += 1
        elif char == 'G':
            count[3] += 1
        elif char == 'T':
            count[4] += 1
    for i in range(1, 5):
        if count[i] > t:
            return '==='
    result = ''
    for char in s:
        if char == '?':
            for i in range(1, 5):
                if count[i] < t:
                    count[i] += 1
                    if i == 1:
                        result += 'A'
                    elif i == 2:
                        result += 'C'
                    elif i == 3:
                        result += 'G'
                    elif i == 4:
                        result += 'T'
                    break
        else:
            result += char
    return result

